$(document).ready(function() {
    $('.minus--type_1').click(function () {
        var $input = $(this).parent().find('input');
        var count = parseInt($input.val()) - 1 + " months";
        count = count < 1 ? 1 : count;
        $input.val(count);
        $input.change();
        return false;
    });
    $('.plus--type_1').click(function () {
        var $input = $(this).parent().find('input');
        $input.val(parseInt($input.val()) + 1 + " months");
        $input.change();
        return false;
    });
});


