/* my scripts */

$(document).ready(function() {
    $('.need-valid').on('change keyup paste focusout', function () {
        var error = checkForm(this);

        if (!error){
            $(this).addClass('err').closest('.input-block').addClass('err-required');
        } else {
            $(this).removeClass('err').closest('.input-block').removeClass('err-required');
        }
    });

    $('[data-fancybox]').fancybox({
        touch: false,
        clickSlide: false,
        animationEffect: "zoom-in-out",
    });


    $('.datepicker-input').datepicker();
    setTimeout(function () {
        $('.message__info').slideDown();
    }, 5000);

    $(".sell-car-page .slides").owlCarousel({
        items: 1,
        loop: false,
        mouseDrag: false,
        touchDrag: false,
        pullDrag: false,
        rewind: false,
        dots: false,
        autoHeight:true
    });

    $('#skip-checkbox').change(function () {
        if($(this).is(":checked")) {
            $('#btn-images').prop('disabled', false);
        } else {
            if (!checkImages()) {
                $('#btn-images').prop('disabled', true);
            }
        }
    });

    $('.key-spec input[type="checkbox"]').change(function () {
        if($(this).is(":checked")) {
            $(this).parents('tr').addClass('checked');
        } else {
            $(this).parents('tr').removeClass('checked');
        }
    });

    $('[name="dd_model"]').change(function () {
        $('[name="dd_model"]').parents('.radio-btn').addClass('no-select');
        $(this).parents('.radio-btn').removeClass('no-select');
        $('.step-2').slideDown()
        if ($('#step-id').html() == '1') { $('#step-id').html('2'); }
    });

    $('[name="dd_variant"]').change(function () {
        $('.step-2 tr').addClass('no-select');
        $(this).parents('tr').removeClass('no-select');
        $('.btn-next').prop('disabled', false);
    });


    $('.new-cars-page .btn-next').click(function () {
        event.preventDefault();
        $('.step-1-2').hide();
        $('.step-3').show();
        if ($('#step-id').html() == '2') { $('#step-id').html('3'); }
    });

    $('.new-cars-page .btn-prev').click(function () {
        event.preventDefault();
        $('.step-3').hide();
        $('.step-1-2').show();
        if ($('#step-id').html() == '3') { $('#step-id').html('2'); }
    });

    $(".images-upload-block input:file").change(function (){
        if ($(this).val() != '') {
            $(this).closest('.item').addClass('uploaded');
        } else {
            $(this).closest('.item').removeClass('uploaded');
        }
        if (checkImages()) {
            $('#btn-images').prop('disabled', false);
        } else {
            if(!$(this).is(":checked")) {
                $('#btn-images').prop('disabled', true);
            }
        }
    });

    $('#start-live-chat').click(function () {
        var mode = $('input[name="department"]:checked').val();
        if (mode == 'carsales') {
            $('#chat-select .step').removeClass('active');
            $('#chat-select .step-3').addClass('active');
            $('#chat-select .go-back').show();
        } else if (mode == 'service') {
            $('#chat-select .step').removeClass('active');
            $('#chat-select .step-2').addClass('active');
            $('#chat-select .go-back').show();
        }
    });
    $('#chat-select .go-back').click(function () {
        $('#chat-select .step').removeClass('active');
        $('#chat-select .step-1').addClass('active');
        $('#chat-select .go-back').hide();
    });
});

function checkImages(){
    var checkImage = true,
        countImage = 0;

    $(".images-upload-block input:file").each(function () {
        if ($(this).val() == '') {
            checkImage = false;
        } else {
            countImage++;
        }
    });
    $('#img-count').html(countImage);
    return checkImage;
}

function sliderChange(sliderNo) {
    event.preventDefault();
    switch (sliderNo) {
        case 1:
            $('.sell-car-page .slides').trigger('to.owl.carousel', 1);
            break;
        case 2:
            var test = true;
            $('.sell-car-page .slide-2 .need-valid').each(function () {
                if (!checkForm(this)) {
                    test = false;
                    $(this).addClass('err').closest('.input-block').addClass('err-required');
                }
            });
            if (test) $('.sell-car-page .slides').trigger('to.owl.carousel', 2);
            break;
        case 3:
            var test = true;
            $('.sell-car-page .slide-3 .need-valid').each(function () {
                if (!checkForm(this)) {
                    test = false;
                    $(this).addClass('err').closest('.input-block').addClass('err-required');
                }
            });
            if (test) $('.sell-car-page .slides').trigger('to.owl.carousel', 3);
            break;
        case 4:
            var test = true;

            if (test) $('.sell-car-page .slides').trigger('to.owl.carousel', 4);
            break;
        case 5:
            var test = true;
            $('.sell-car-page .slide-5 .need-valid').each(function () {
                if (!checkForm(this)) {
                    test = false;
                    $(this).addClass('err').closest('.input-block').addClass('err-required');
                }
            });
            if (test) $('.sell-car-page .slides').trigger('to.owl.carousel', 5);
            break;
        default:
            break;
    }
}

function checkForm(elem){
    var name = $(elem).attr('name'),
        value = $(elem).val(),
        result = false;
        re = '';
    switch (name) {
        case 'email':
             re = /\S+@\S+\.\S+/;
             result = re.test(value);
            break;
        case 'phone':
            re =/^[0-9-+]{6,18}$/
            result = re.test(value);
            break;
        case 'postcode':
            re =/^[0-9]{4,10}$/
            result = re.test(value);
            break;
        default:
             re = /\S{1,}$/;
             result = re.test(value);
    }

    return result;
}
